import React from "react";
import Slider from "react-slick";
import rapperImage from "../../resources/HomeSlider/Rapper-bohemia-wallpapers.jpg";
const HomeSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div style={{ "background-color": "white" }}>
      <Slider {...settings}>
        <div>{/* <img src={rapperImage}></img> */}</div>
        <div>
          <img
            src={"../../resources/HomeSlider/Rapper-bohemia-wallpapers.jpg"}
          ></img>
        </div>
        <div>
          <img
            src={"../../resources/HomeSlider/Rapper-bohemia-wallpapers.jpg"}
          ></img>
        </div>
        <div>
          <img
            src={"../../resources/HomeSlider/Rapper-bohemia-wallpapers.jpg"}
          ></img>
        </div>
        <div>
          <img
            src={"../../resources/HomeSlider/Rapper-bohemia-wallpapers.jpg"}
          ></img>
        </div>
      </Slider>
    </div>
  );
};

export default HomeSlider;
